import React from "react";
import './EventCard.css';

const EventCard = ({ event }) => {
    const {
        name,
        event_website,
        description,
    } = event;
    return (
        <div className="event-card">
            <h2>{name}</h2>
            <p></p>
            <a href={event_website} target="_blank" rel="">Open Streaming Website</a>
        </div>
    );
};

export default EventCard;
